pragma solidity >=0.5.4 <0.6.0;
import "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC721/IERC721.sol";


contract Charger {

    string public geo;
    string public name;
    address public owner; // ??? Or taken from "Ownable" or no address at all

    IERC20 public erc20Token;
    IERC721 public securityToken;
    uint public price = 150;

    struct priceTag {
        string from;
        string to;
        uint256 amount; 
    }

    priceTag[] public prices;

    // Just 
    mapping(address => uint256) reservations;
    uint256[] reservationsTime;

    enum Status {
      Charging,
      Waiting,
      Free
    }

    Status public currentStatus;

    // график зарезервированных броней на зарядку (интервалы занятого время)
    // метод бронирования (платный)

    constructor(string memory _geo, string memory _name, address _owner, address _erc20Addr/*, address _erc721Addr*/) public {
        geo = _geo;
        name = _name;
        owner = _owner;
        erc20Token = IERC20(_erc20Addr);
        // securityToken = IERC721(_erc721Addr);
        currentStatus = Status.Free;

        priceTag memory _price = priceTag({
            from: "8:00",
            to: "23:00",
            amount: 150
        });
        prices.push(_price);
    }

    function startCharging() public payable {
        // require(securityToken.balanceOf(msg.sender) > 1, "You don't have security token");
        // There's got to be approve from client on tokens
        erc20Token.transferFrom(msg.sender,address(this),price);
        currentStatus = Status.Charging;

    }

    function addRate(string memory _from, string memory _to, uint256 _newRate) public {
        priceTag memory _price = priceTag({
            from: _from,
            to: _to,
            amount: _newRate
        });
        prices.push(_price);
    }


