    //     for (uint24 i = 0; i < prices.length; i++) {
    //         froms[i] = prices[i].from;
    //         tos[i] = prices[i].to;
    //         amounts[i] = prices[i].amount;
    //     }
    //     return (froms,tos,amounts);
    // }

    function pricesLength() public view returns(uint) {
        return prices.length;
    }

    function reserve() public view returns(uint) {
        return block.timestamp;
    } 
}
